import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      {/* Header Navigation */}
      <header className="header">
        <div className="copyright">Â© Arc Deepa Devangmath</div>
        <nav>
          <ul className="nav-links">
            <li><a href="#work">Work</a></li>
            <li><a href="#about">About</a></li>
            <li><a href="#contact">Contact</a></li>
          </ul>
        </nav>
      </header>

      {/* Main Content */}
      <div className="main-content">
        {/* Location Tag */}
        <div className="location-tag">
          <img src={chicagoImage} alt="Chicago" className="chicago-image" />
          <div className="location-content">
            <p>Chicago-Based Architect</p>
          </div>
        </div>

        {/* Hero Content */}
        <div className="hero-content">
          <h1 className="hero-title">Potefolio</h1>
          <p className="hero-subtitle">Freelance Designer & Developer</p>
        </div>
      </div>

      {/* Hero Image */}
      <div className="hero-image">
        <img src={heroImage} alt="Hero" />
      </div>
    </div>
  );
};

export default Home;
